import React from 'react';


const Home =() => {
  return (
  <>
    <section class="apps_banner   apps_bannerBG  apps_lightBg clearfix" id="apps_bannerCon"></section>
    <h1 class="mainh">Online Truck Booking Made Easy</h1>
    <div class="apps_container">
    <div class="apps_row">
    <div class="apps_col12">
    <div class="apps_banner_content">
      <div className="fixed-shape-bottom">
        <img src="Truck.jpg"/>
      </div>
    </div>  
    </div>
    </div>
    </div>
     
</>
);
}; 
  export default Home;
